'use strict';

describe('Profile Controller', function() {
    var ctrl, scope, profilefactory;

    beforeEach(angular.mock.module('app'));
 
    beforeEach(angular.mock.inject(function($controller, $rootScope, $injector) { 
        scope = $rootScope.$new();
        profilefactory = $injector.get('ProfileFactory');
 
        ctrl = $controller('ProfileController', {
            $scope: scope,
        });
 
    }));
    

    it('$scope.userData should be assigned the userdata', angular.mock.inject(function($injector) {
        var userData = profilefactory.getUserData();

        expect(scope.userData).toBe(userData);
    })); 
        

    it('$scope.delete() should delete photo and set profilePhoto to true', angular.mock.inject(function($injector) {
        scope.profilePhoto = false; //you can only delete if you have a photo uploaded, in which case profilePhoto is false
        spyOn(profilefactory, 'delete');
        scope.deletePhoto();

        expect(profilefactory.delete).toHaveBeenCalled();
        if (scope.confirmed) {
         expect(scope.profilePhoto).toBe(true); // if confirmed is true user clicked Ok on popup window
        } else {
         expect(scope.profilePhoto).toBe(false); // if confirmed is false user clicked cancel on popup window
        }
    }));

    it('$scope.uploadPhoto() should set $scope.profilePhoto false and $scope.profileIMG should have a value', angular.mock.inject(function($injector) {
        spyOn(profilefactory, 'savePhoto');

        var base64 = ""

        var byteChars = atob(base64);
        var byteNums = new Array(byteChars.length);
        for (var i = 0; i < byteChars.length; i++) {
        byteNums[i] = byteChars.charCodeAt(i);
        }
        var byteArray = new Uint8Array(byteNums);
        var imgFile = new Blob([byteArray], {type: "image/.jpeg"});
        scope.uploadPhoto(imgFile);

        expect(scope.profilePhoto).toBe(false);
        //expect(profilefactory.savePhoto).toHaveBeenCalled();
        //expect(scope.profileIMG).toBe(base64);
    }));

    it('$factory.convertBirthday should convert the birthday from milliseconds to a string', angular.mock.inject(function($injector) {
        // mock the function so we can test with userbday in place of userData.birthdate 
        profilefactory.convertBirthday = function (userbday) {
             var bday = new Date(userbday); 
             var year = bday.getFullYear();

             var months = [ "January",
                            "February",
                            "March",
                            "April",
                            "May",
                            "June",
                            "July",
                            "August",
                            "September",
                            "October",
                            "November",
                            "December"];

             var month = months[bday.getMonth()];
             var day = bday.getDate();
             var birthdayString = (month +" "+ day +" "+ year);
        
         return birthdayString;
          }

        var userbday = 766220400000; // April 13 1994 in milliseconds

        expect(profilefactory.convertBirthday(userbday)).toBe("April 13 1994");
    }));

    
  });






    
